const processResultRegistration = async (
  clientEmail, passwordNew, passwordNewRepeat, history, setClassIncorrectUser,
  postChangePasswordRequest,
) => {
  const result = await postUsers(firstName,
    lastName, email, password, phoneNumber, address);
  if (result === true) {
    setClassIncorrectUser('existingUser', 'existingUserStringBlock');
  } else {
    history.push('/personal'); onEnter(false, true); onLogin(false, false, false);
  }
};

export default processResultRegistration;
